import React from 'react';

function Clicker(props)	
	{
	let testfun =function test()
		{
		props.HandleClick;
		console.log("testing 123");	
		}	
	return(
		<div>
		{props.name}
		<button 
			name={props.name} 
			onClick={testfun} 
			data-target={props.subjectsOfIncrease}> 
				{props.name} {props.value}
	
		</button>
		</div>


		)
}

export default Clicker;
